INSERT INTO `platforms` VALUES (1,'Academics.de','academics.de bietet eine umfangreiche Plattform zum Thema Wissenschaft und Forschung in Deutschland, Ã–sterreich und der Schweiz. Die Stellenangebote kommen von forschenden Unternehmen, Forschungseinrichtungen und Hochschulen. Die Aufteilung der JobbÃ¶rse nach Forschungsgebieten und Karrierestationen ermÃ¶glicht Unternehmen eine zielgerichtete Schaltung von Stellenanzeigen.','http://www.academics.de',8,4,0,1,1,'2010-09-20 08:24:01','2012-01-23 15:57:41','academics.png','image/png',3335,'2010-10-06 13:06:34',10,NULL,''),(2,'Gak.de - Gummi Fasern Kunststoffe - Fachmagazin fÃ¼r die Polymerindustrie','GAK - Gummi Fasern, Kunststoffe ist ein Fachmagazin der Polymerindustrie und bietet auf seiner Website neben redaktionellem Content auch eine JobbÃ¶rse an. Der Stellenmarkt hat 150.000 Visits pro Monat und kooperiert mit der StellenbÃ¶rse plasticker.de. Durch die MÃ¶glichkeit, zielgerichtet qualifiziertes technisches oder kaufmÃ¤nnisches Fachpersonal anzusprechen, haben Unternehmen hier die MÃ¶glichkeit, eine zielgruppenorientierte und punktgenaue Personalgewinnung zu betreiben.','http://www.gupta-verlag.com/kautschuk',5,2,0,1,1,'2010-09-21 10:19:39','2012-01-24 15:50:54','GAK.PNG','image/png',21491,'2010-09-21 10:19:39',8,306,''),(4,'Dprg.de','Praktikanten- und TraineebÃ¶rse der Deutschen Public Relations Gesellschaft e. V. - Berufsverband fÃ¼r alle PR-Fachleute in Deutschland. ','http://www.dprg.de',6,4,0,1,1,'2010-09-21 10:22:11','2012-01-24 13:23:30','dprg.jpg','image/jpeg',13766,'2012-01-24 13:23:30',7,NULL,''),(7,'Jarocco.de','jarocco.de ist ein Netzwerk fÃ¼r Akademiker, das im angeschlossenen Stellenmarkt Jobs fÃ¼r Akademiker aus allen Branchen anbietet. Daneben werden ebenso ausschlieÃŸlich bezahlte Praktikastellen fÃ¼r die Zielgruppe ausgeschrieben. Der Newsletter an 900 Abonnenten bringt zusÃ¤tzliche Aufmerksamkeit auf die eigene Stellenanzeige. Durch die hohe Reichweite kÃ¶nnen Unternehmen ein groÃŸes, hochqualif